import { useState } from "react";

export default function MyCheckbox() {
  const [liked, setLiked] = useState(true);

  function handleChange(e) {
    setLiked(e.target.checked);
  }
  return (
    <div>
      <label>
        <input type="checkbox" checked={liked} onChange={onChange} />
      </label>
    </div>
  );
}
